// This is the load and setup for the simulator

var mojioMap = new Mojio.Map('simulator-map', mojioClient);
var mojioSimulator = new Mojio.Simulator(mojioClient);

var _rowFactory,
    _container;

_rowFactory = $('#eventTemplate');
_rowFactory.detach();
_rowFactory.removeAttr('id');

_container = $('#events');
_container.sortable();

function setValues(el, prefix, value) {
    if (typeof value === 'object')
        for (var k in value)
            setValues(el, prefix + k, value[k]);
    else
        el.find(prefix).val(value);
}

function addEvent(event) {
    var row = _rowFactory.clone();

    setValues(row, '.input', event);

    var type = row.find('.inputEventType');

    var onEventTypeChange = function () {
        var val = type.val();

        row.find('.onlyEventTypes').hide();
        row.find('.onlyType' + val).show();

        row.find('.toggle-icon').addClass('icon-toggle-up fa-toggle-up');
        row.find('.toggle-icon').removeClass('icon-toggle-down fa-toggle-down');
    }

    type.change(onEventTypeChange);

    onEventTypeChange();

    _container.prepend(row);
    $('.tip').tooltip();
}

function importEvents(events) {
    events.sort(function (a, b) {
        return b.Time < a.Time ? 1 : -1;
    });

    $.each(events, function () {
        addEvent(this);
    });
}

function importKML(xml) {
    var elements = [];

    xml.find('coordinates').each(function () {
        el = $(this);

        var placemark = el.closest('Placemark');
        if (!placemark) return;

        var time = placemark.children('TimeSpan').children('begin').first().text();
        if (!time) return;

        //var date = client.parseDate( time);
        var coords = el.text().split(",");

        elements[elements.length] = {
            EventType: "TripEvent",
            Time: time,
            Location: { Lat: coords[0], Lng: coords[1] }
        };
    });

    if (elements.length > 50)
        elements = elements.slice(0, 50);

    importEvents(elements);
}

function importGPX(xml) {
    var elements = [];

    xml.find('trkpt').each(function () {
        el = $(this);

        var time = el.find('time:first').text();
        //var date = client.parseDate( time);

        elements[elements.length] = {
            EventType: "TripEvent",
            Time: time,
            Location: { Lat: el.attr('lat'), Lng: el.attr('lon') }
        };
    });
    if (elements.length > 50)
        elements = elements.slice(0, 50);

    importEvents(elements);
}

function loadSample(name) {
    var sample = samples[name];
    if (sample.TripId) {
        // Load trip!
        $.getJSON("/simulator/trip/" + sample.TripId, function (data) {
            loadEvents(data);
        });
    } else {
        loadEvents(sample.Events);
    }
}

function loadEvents(e) {
    var events = e.reverse();

    for (i = 0 ; i < events.length ; i++) {
        addEvent(events[i]);
    }
}

function loadSamples(containerId) {
    var div = $('#' + containerId);

    for (var sample in samples) {
        var el = $('<li />').attr('data-sample', sample).append($('<a />').attr('href', '#').html(samples[sample].Title))

        el.click(function (e) {
            e.preventDefault();
            _container.empty();
            loadSample($(this).attr('data-sample'));

            // Switch tab
            $('.tabs a[href="#createTrips"]').tab('show');
            $('.hide-all-button').removeClass('hidden');
            $('.preset-trip-container').html("Preset Added: " + $(this).find("a").html());
            $('.preset-trip-container').removeClass('hidden');
        });

        div.append(el);
    }
}

function makeid() {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

    for (var i = 0; i < 20; i++)
        text += possible.charAt(Math.floor(Math.random() * possible.length));

    return text;
}

function loadMojioVehicles() {
    var select = $("#vehicleId").html('');
    select.append($("<option />").val("").text("Loading..."));

    mojioClient.get("users", mojioClient.userId(), "vehicles", null, 20).done(function (result) {
        select = $("#vehicleId").html('');

        if (result.Data.length <= 0) {
            // User does not have any devices yet! Create a dummy device.
            mojioClient.insert("mojios", { Imei: "SimTest_" + makeid(), Name: "Dummy Simulator Device" }).done(function (mojio) {
                mojioClient.insert("vehicles", { MojioId: mojio._id, Name: "Dummy Simulator Car" }).done(function (data) {
                    select.append($("<option />").val(data._id).text(data.Name));
                    mojioMap.addVehicle(data);

                    select.prop("disabled", false);
                    mojioMap.subscribe();
                });
            });
        } else {
            $.each(result.Data, function () {
                select.append($("<option />").val(this._id).text(this.Name ? this.Name : this._id));
                mojioMap.addVehicle(this);
            });

            select.prop("disabled", false);
            mojioMap.subscribe();
        }
    });
}

function webConsole(output) {
    var now = new Date();

    var str = now.getHours() + ":" + now.getMinutes() + ":" + now.getSeconds() + ":" + now.getMilliseconds();

    $('#logging').prepend(
        str + " -- " + output + "\n"
    );
}

mojioClient.ready(function () {
    mojioClient.onLogin(loadMojioVehicles);

    mojioClient.onEvent(function (event) {
        var log = event.EventType + " event received.";
        webConsole(log);
    });

    mojioSimulator.onSend(function (e, el, data) {
        var log = data.EventType + " event being sent.";
        webConsole(log);

        $(el).removeClass('next');
        $(el).addClass('sending');

        eventsAutoScroll(el.next());
    });

    mojioSimulator.onSuccess(function (e, el, data) {
        var log = data.EventType + " event successfully sent.";
        webConsole(log);

        $(el).removeClass('sending');
        $(el).addClass('success');
    });

    mojioSimulator.onFail(function (e, el, data) {
        var log = event.EventType + " EVENT FAILED TO SEND";
        webConsole(log);

        $(el).removeClass('sending');
        $(el).addClass('error');
    });

    loadSamples('simulatorSamples');

    $('#newEventButton').click(function (e) {
        e.preventDefault();
        addEvent(null);

        $('.hide-all-button').removeClass('hidden');
    });

    function setActiveControl(element) {
        var el = $(element);
        el.parent().find('.active').removeClass('active');
        el.addClass('active');
    }

    function eventsAutoScroll(el) {

        if (el.length == 0) return;

        var parent = el.scrollParent();
        var offset = el.first().offset().top + el.outerHeight() - parent.offset().top;
        var height = parent.innerHeight();

        if (offset >= height - 1) {
            var pos = parent.scrollTop() + offset - height;
            parent.animate({
                scrollTop: pos
            }, 50);
        }
    }

    $('#playButton').click(function (e) {
        e.preventDefault();

        var vehicleId = $('#vehicleId').val();

        setActiveControl(this);

        mojioMap.follow(vehicleId);
        mojioSimulator.setVehicleId(vehicleId);
        mojioSimulator.play();

        $('#loading').css('display', 'none');
    });

    $('#pauseButton').click(function (e) {
        e.preventDefault();

        setActiveControl(this);

        if (mojioSimulator.getState() == 'Paused')
            mojioSimulator.step();
        else
            mojioSimulator.pause();
    });

    $('#stopButton').click(function (e) {
        e.preventDefault();

        setActiveControl(this);

        mojioSimulator.pause();
    });
});

var removeEvent = function (el) {
    $(el).closest('li').remove();
    return false;
}

var toggleEventOptions = function (el) {
    var closestEl = $(el).closest('li');
    var val = closestEl.find('.inputEventType').val();

    if (closestEl.find('.toggle-icon').hasClass('icon-toggle-up') || closestEl.find('.toggle-icon').hasClass('fa-toggle-up')) {
        closestEl.find('.toggle-icon').removeClass('icon-toggle-up fa-toggle-up');
        closestEl.find('.toggle-icon').addClass('icon-toggle-down fa-toggle-down');
        closestEl.find('.onlyType' + val).hide();
    } else {
        closestEl.find('.toggle-icon').addClass('icon-toggle-up fa-toggle-up');
        closestEl.find('.toggle-icon').removeClass('icon-toggle-down fa-toggle-down');
        closestEl.find('.onlyType' + val).show();
    }

    return false;
}

var collapseAllButton = function () {
    $('.toggle-icon').removeClass('icon-toggle-up fa-toggle-up');
    $('.toggle-icon').addClass('icon-toggle-down fa-toggle-down');
    $('li').find('.onlyEventTypes').hide();

    return false;
}


